// Polyfill for React Native Blob in web environment

// Use native Blob if available, otherwise create a simple polyfill
const BlobPolyfill = typeof Blob !== 'undefined' ? Blob : class Blob {
  constructor(parts = [], options = {}) {
    this.parts = parts;
    this.type = options.type || '';
    this.size = parts.reduce((total, part) => {
      if (typeof part === 'string') {
        return total + part.length;
      }
      return total + (part.size || 0);
    }, 0);
    // Add data property for React Native compatibility
    this.data = {
      blobId: Math.random().toString(36).substr(2, 9),
      offset: 0,
      size: this.size,
      name: options.name || '',
      type: this.type
    };
  }

  slice(start = 0, end = this.size, contentType = '') {
    const slicedParts = [];
    let currentPos = 0;

    for (const part of this.parts) {
      const partSize = typeof part === 'string' ? part.length : (part.size || 0);

      if (currentPos + partSize > start && currentPos < end) {
        const partStart = Math.max(0, start - currentPos);
        const partEnd = Math.min(partSize, end - currentPos);

        if (typeof part === 'string') {
          slicedParts.push(part.slice(partStart, partEnd));
        } else {
          slicedParts.push(part.slice(partStart, partEnd));
        }
      }

      currentPos += partSize;
      if (currentPos >= end) break;
    }

    return new BlobPolyfill(slicedParts, { type: contentType });
  }

  text() {
    return Promise.resolve(this.parts.join(''));
  }

  arrayBuffer() {
    const text = this.parts.join('');
    const buffer = new ArrayBuffer(text.length);
    const view = new Uint8Array(buffer);
    for (let i = 0; i < text.length; i++) {
      view[i] = text.charCodeAt(i);
    }
    return Promise.resolve(buffer);
  }
};

// File polyfill
const FilePolyfill = typeof File !== 'undefined' ? File : class File extends BlobPolyfill {
  constructor(parts, name, options = {}) {
    super(parts, options);
    this.name = name;
    this.lastModified = options.lastModified || Date.now();
  }
};

// FileReader polyfill
const FileReaderPolyfill = typeof FileReader !== 'undefined' ? FileReader : class FileReader {
  constructor() {
    this.readyState = 0; // EMPTY
    this.result = null;
    this.error = null;
    this.onload = null;
    this.onerror = null;
    this.onloadend = null;
  }

  readAsText(blob) {
    this.readyState = 1; // LOADING

    setTimeout(() => {
      try {
        if (blob && blob.text) {
          blob.text().then(text => {
            this.result = text;
            this.readyState = 2; // DONE
            if (this.onload) this.onload({ target: this });
            if (this.onloadend) this.onloadend({ target: this });
          });
        } else {
          this.result = blob.parts ? blob.parts.join('') : '';
          this.readyState = 2; // DONE
          if (this.onload) this.onload({ target: this });
          if (this.onloadend) this.onloadend({ target: this });
        }
      } catch (error) {
        this.error = error;
        this.readyState = 2; // DONE
        if (this.onerror) this.onerror({ target: this });
        if (this.onloadend) this.onloadend({ target: this });
      }
    }, 0);
  }

  readAsDataURL(blob) {
    this.readyState = 1; // LOADING

    setTimeout(() => {
      try {
        const text = blob.parts ? blob.parts.join('') : '';
        this.result = `data:${blob.type || 'text/plain'};base64,${btoa(text)}`;
        this.readyState = 2; // DONE
        if (this.onload) this.onload({ target: this });
        if (this.onloadend) this.onloadend({ target: this });
      } catch (error) {
        this.error = error;
        this.readyState = 2; // DONE
        if (this.onerror) this.onerror({ target: this });
        if (this.onloadend) this.onloadend({ target: this });
      }
    }, 0);
  }
};

// URL polyfill
const URLPolyfill = typeof URL !== 'undefined' ? URL : class URL {
  static createObjectURL(blob) {
    return `blob:${Math.random().toString(36).substr(2, 9)}`;
  }

  static revokeObjectURL(url) {
    // No-op for polyfill
  }
};

// Export for both CommonJS and ES6 compatibility
export { BlobPolyfill as Blob, FilePolyfill as File, FileReaderPolyfill as FileReader, URLPolyfill as URL };
export default BlobPolyfill;

// CommonJS exports
if (typeof module !== 'undefined' && module.exports) {
  module.exports = BlobPolyfill;
  module.exports.Blob = BlobPolyfill;
  module.exports.File = FilePolyfill;
  module.exports.FileReader = FileReaderPolyfill;
  module.exports.URL = URLPolyfill;
  module.exports.default = BlobPolyfill;
}

// Global polyfill
if (typeof global !== 'undefined') {
  if (!global.Blob) global.Blob = BlobPolyfill;
  if (!global.File) global.File = FilePolyfill;
  if (!global.FileReader) global.FileReader = FileReaderPolyfill;
  if (!global.URL) global.URL = URLPolyfill;
}

if (typeof window !== 'undefined') {
  if (!window.Blob) window.Blob = BlobPolyfill;
  if (!window.File) window.File = FilePolyfill;
  if (!window.FileReader) window.FileReader = FileReaderPolyfill;
  if (!window.URL) window.URL = URLPolyfill;
}
